import React, { useState, useEffect } from "react";

export default function History() {
  const [records, setRecords] = useState([]);

  useEffect(() => {
    fetch("http://localhost:5000/api/records")
      .then(res => res.json())
      .then(data => setRecords(data))
      .catch(err => {
        console.error("Lỗi tải lịch sử:", err);
        setRecords([]);
      });
  }, []);

  return (
    <div style={{ padding: 20, fontFamily: "Arial", background: "#f4f4f4", minHeight: "100vh" }}>
      {/* NÚT QUAY LẠI + TIÊU ĐỀ */}
      <div style={{ display: "flex", alignItems: "center", justifyContent: "space-between", marginBottom: 20 }}>
        <button
          onClick={() => window.location.href = "/"}  // quay về Dashboard
          style={{
            padding: "12px 24px",
            background: "#333",
            color: "white",
            border: "none",
            borderRadius: 8,
            cursor: "pointer",
            fontSize: 16,
            fontWeight: "bold",
            boxShadow: "0 4px 10px rgba(0,0,0,0.2)"
          }}
        >
          ← QUAY LẠI DASHBOARD
        </button>

        <h1 style={{ margin: 0, color: "#d32f2f", textAlign: "center", flex: 1 }}>
          LỊCH SỬ PHƯƠNG TIỆN ĐÃ QUA (CHỈ ADMIN XEM ĐƯỢC)
        </h1>

        <div style={{ width: 180 }}></div> {/* để cân bằng layout */}
      </div>

      {records.length === 0 ? (
        <div style={{ textAlign: "center", padding: "60px", background: "white", borderRadius: 12, boxShadow: "0 0 15px rgba(0,0,0,0.1)" }}>
          <p style={{ fontSize: 20, color: "#999" }}>
            Chưa có dữ liệu – cho xe đi qua vạch vàng để lưu nhé!
          </p>
        </div>
      ) : (
        <div style={{ overflowX: "auto", background: "white", borderRadius: 12, boxShadow: "0 0 20px rgba(0,0,0,0.15)" }}>
          <table style={{ width: "100%", minWidth: 1200, borderCollapse: "collapse" }}>
            <thead style={{ background: "#d32f2f", color: "white" }}>
              <tr>
                <th style={thStyle}>ID Xe</th>
                <th style={thStyle}>Biển số</th>
                <th style={thStyle}>Loại xe</th>
                <th style={thStyle}>Hướng</th>
                <th style={thStyle}>Thời gian</th>
                <th style={thStyle}>Ảnh toàn cảnh</th>
                <th style={thStyle}>Ảnh biển số</th>
              </tr>
            </thead>
            <tbody>
              {records.map(r => (
                <tr key={r.id} style={{ borderBottom: "2px solid #eee", background: r.id % 2 === 0 ? "#fdfdfd" : "white" }}>
                  <td style={tdStyle}>{r.track_id}</td>
                  <td style={tdStyle}>
                    <b style={{ color: "#d32f2f", fontSize: 20 }}>{r.plate_number}</b>
                  </td>
                  <td style={tdStyle}>{r.vehicle_type || "N/A"}</td>
                  <td style={tdStyle}>
                    <span style={{ 
                      padding: "6px 12px", 
                      borderRadius: 20, 
                      background: r.direction === "up" ? "#4caf50" : "#f44336",
                      color: "white",
                      fontWeight: "bold"
                    }}>
                      {r.direction?.toUpperCase()}
                    </span>
                  </td>
                  <td style={tdStyle}>
                    {new Date(r.detected_at).toLocaleString("vi-VN", {
                      weekday: "short",
                      day: "2-digit",
                      month: "2-digit",
                      year: "numeric",
                      hour: "2-digit",
                      minute: "2-digit",
                      second: "2-digit"
                    })}
                  </td>
                  <td style={tdStyle}>
                    <img 
                      src={`http://localhost:5000/${r.full_image_path}`} 
                      alt="full" 
                      style={{ width: 280, height: 160, objectFit: "cover", borderRadius: 10, boxShadow: "0 4px 10px rgba(0,0,0,0.2)" }}
                    />
                  </td>
                  <td style={tdStyle}>
                    <img 
                      src={`http://localhost:5000/${r.plate_image_path}`} 
                      alt="plate" 
                      style={{ width: 180, height: 90, objectFit: "contain", border: "4px solid #d32f2f", borderRadius: 10, boxShadow: "0 4px 15px rgba(211,47,47,0.4)" }}
                    />
                  </td>
                </tr>
              ))}
            </tbody>
          </table>
        </div>
      )}

      <div style={{ textAlign: "center", marginTop: 30, color: "#666", fontSize: 14 }}>
        © 2025 Hệ thống nhận diện biển số Việt Nam - Phát triển bởi bạn
      </div>
    </div>
  );
}

const thStyle = { padding: "16px 12px", textAlign: "center", fontSize: 16, fontWeight: "bold" };
const tdStyle = { padding: "16px 10px", textAlign: "center", verticalAlign: "middle" };
